string1 = "BJMU:"
string2 = "BJMU:"

if string1 == string2:
    print("两个字符串相等")
else:
    print("两个字符串不相等")

def find_differences(s1, s2):
    # 找出两个字符串中较短的长度，以便在循环中不会超出索引范围
    min_length = min(len(s1), len(s2))
    
    differences = []
    
    # 比较两个字符串中的每个字符
    for i in range(min_length):
        if s1[i] != s2[i]:
            differences.append(f"位置 {i}: '{s1[i]}' vs '{s2[i]}'")
    
    # 处理长度不同的部分
    if len(s1) > len(s2):
        for i in range(len(s2), len(s1)):
            differences.append(f"位置 {i}: '{s1[i]}' vs 'None'")
    elif len(s2) > len(s1):
        for i in range(len(s1), len(s2)):
            differences.append(f"位置 {i}: 'None' vs '{s2[i]}'")
    
    return differences

# 示例字符串


# 找出不同部分
diffs = find_differences(string1, string2)

# 打印不同的部分
if diffs:
    print("两个字符串在以下位置不同:")
    for diff in diffs:
        print(diff)
else:
    print("两个字符串相等")
